import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';

const styles = theme => ({
  button: {
    margin: "1px",
  },
  page: {
    marginTop: "24px",
    textAlign: "center"
  }
});

function PageChild(props) {
    const { classes, total, current } = props;
    var res = [];
    if(total>10) {
        for (var i=0; i<10; i++) {
            res.push(<Button variant="outlined" size="small" color="primary" className={classes.button}>{i}</Button>);
        }
    }
    return res;
}

function Page(props) {
  const { classes, total, current } = props;
  return (
    <div className={classes.page}>


      <Button variant="outlined" size="small" color="primary" disabled={current<= 1?'true':'false'} className={classes.button}>
        Previous
      </Button>
      <PageChild />
      <Button variant="outlined" size="small" color="primary" className={classes.button}>
        Next
      </Button>
    </div>
  );
}

Page.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(Page);
